import React, { useContext } from "react";
import { cartContext } from "./../context/cartContext";

const CheckOut = (props) => {
	const ctx = useContext(cartContext);

	return ctx.cart.map((item) => {
		return <h1>{item.name}</h1>;
	});
};

export default CheckOut;
